import React from 'react'

const Groupe4 = () => {
    return (
        <div className='container' style={{
            height:'100vh',
            marginTop:'100px'
        }}>

            <p style={{
                color:'gray',
                fontWeight:'bold'
            }}>Nos marques</p> 

            <h2>
            Toutes les entités du groupe concourent au même objectif,<br/>
            <span className=''> avec des cibles différentes</span>
            </h2>

        </div>
    )
}

export default Groupe4
